import nltk
nltk.download("stopwords")
from nltk.corpus import stopwords
stops = stopwords.words("english")

stops.append(['cup', 'cups', 'teaspoon', 'teaspoons', 'tablespoons', 'tablespoon', 'whole', 'chopped', 'and', 'g','ounce', 'ounces', 'ground', 'or', 'oz', 'weight', 'to', 'can', 'tbsp', 'tsp', 'of'])

result_1 = []
def remove_stopwords(sentence):
  for word in sentence.split():
      if word not in stops:
          result_1.append(word)
df['clean_ingredients'].apply(remove_stopwords)

result_dict_1 = {}
for word in result_1:
    if word not in result_dict_1:
        result_dict_1[word] = 1
    else:
        result_dict_1[word] += 1

pd.Series(result_dict_1).sort_values(ascending=False).head(30)
